import { TextInput, View } from "react-native";
import React from "react";
import { PrimaryButton } from "../components/ui/Buttons";

const StartGame = () => {
  return (
    <View>
      <TextInput />
      <PrimaryButton>Reset</PrimaryButton>
    </View>
  );
};

export default StartGame;
